import React, { Component } from 'react';
import Card from './Card'
import { CardData } from './CardData';

export default class Deck extends Component {
    render() {
        return (
            <div>
                <h1>This is Not a Card (yet)</h1>
                <Card cardInfo={CardData} />
            </div>

        )
    }
}
